window.bookSummaryJSON = "<p>Murdoch’s past has finally come crashing down on him. His former girlfriend. His Family. He’s been happily avoiding them for ages, trying to live something close to a normal life. But now he’s been drawn back into another one of their ludicrous attempts to bring about the end of all things.&nbsp;</p> <p>Chase has spent the past year just trying to get away. Trying to escape the memories that won’t stop following him, the moment when his life collapsed. He’s traveled around the world trying to stay ahead of it all, but those final moments may be catching up with him at last.&nbsp;</p> <p>Anne is tired of living in the past. She’s finally looking to the future and embracing her destiny. She’s going to lead the Family forward on their greatest, final crusade to destroy the hated Machine of their long-time adversary.&nbsp;</p> <p>Their paths will intersect in the middle of nowhere, on an uncharted island where the walls of reality are thin...and an apocalyptic threat is tearing its way through.</p>"; 
